            fontSize: 50,
        }
    })

    return ( 
        <div className="home">
            <h1>
                Hi, I'm mimi, and this is my recent activities on:
                spotify, instagram, tiktok, linkedin, youtube, gmail, pinterest, and discord 
            </h1>
        </div>
     );
}

export default Home;
